  return (
    <>
      <div className="mini-card-container">
        <MiniCard />
        <MiniCard />
      </div>
      <style jsx>
        {`
        .mini-card-container{
          width: 80vw;
          margin: 0 auto;
          display: grid;
          grid-template-columns: 1fr 1fr;
          grid-gap: 10px;
          justify-items: center;
        }
        `}
      </style>
    </>
  );
}
